before & after: the coastal ‘seaside’ living room of my literal dreams 🐚✨

I still can’t believe this is my living space. This open living room concept came from many days of back and forth between @daniklaric and I; because we wanted every single piece to make the space feel coastal, beachy, earthy and overall at home. The morning light transports you into a sunset in Malibu, but during the evenings you feel closed to the coast of Key West, FL. Two of my favorite beach towns in all of the US. We may still add a few colorful frames, but for now… this is my seaside ‘miami-staycation’ living room.

Here’s the deets:
@westelm Customized Harmony 2-Piece Sectional Queen Size Sleeper (I’m obsessed but it took 6 months to get here!)
