BEFORE & AFTER: my dreamy pinterest-inspired earthy dining & kitchen open-space area 🍃🫶🏼

If you don’t know this about me yet…I LOVE HOSTING! So I knew from the get that I wanted a very welcoming dining area that connected seamlessly to my open-space kitchen. I couldn’t have done it without the amazing @daniklaric who seriously help me put this simplistic vision of a beach-condo dining area to life. At night it’s even more beautiful. I have hosted so many gatherings here already that I am just so happy to finally give it some room here on my feed.

Here’s some of the deets:
@wayfair Abberton 78’ Dining Table (literal dream!) 
@wayfair 47’ Wide Server (may change this in the future!)
@allmodern Upholstered Side Chairs (So in love with them!!) 
@cb2 Stature Ivory Dining Chairs (looove them too much!)
@westelm Hayes Linear Chandelier 
@urbanoutfittershome Tabitha Arc Mirror (so worth it!)

Everything else, I’ve linked it for you on my stories & on my home highlight. Who’s down to come for brunch? Haha 🫶🏼

